import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { FontAwesome } from '@expo/vector-icons'; 
import Home from './Layout/Home';
import Notification from './component/header/Notification';
import Wishlist from './component/header/Wishlist'; // Import Wishlist component
import Cart from './component/header/Cart';

const Stack = createStackNavigator();
const Tab = createBottomTabNavigator();

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen
          name="Home"
          component={Home}
          options={{ headerShown: false }} // hide the header for the Home screen
        />
        <Stack.Screen
          name="Notification"
          component={Notification}
          options={{ title: 'Notification' }} // set title for the Notification screen
        />
        <Stack.Screen
          name="Wishlist"
          component={Wishlist}
          options={{ title: 'Wishlist' }} // set title for the Wishlist screen
        />
        <Stack.Screen
          name="Cart"
          component={Cart}
          options={{ title: 'Cart' }} // set title for the Wishlist screen
        />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
